import Logo from '../assets/images/logo2.png'

export default function Home(){
    return (
        <div className='w-[calc(100%-20%)] ' >
            <div className='w-full flex items-center'>
                <img src={Logo} alt={'logo'} width={100}/>
            </div>
        </div>
    )
}
